import React from "react";
import styled from "styled-components";
import MyInfo from "../components/AboutMe/MyInfo";
import Icon from "../components/Share/Icon";
import Header from "../components/Header";
import TimelineComponent from "../components/AboutMe/Timeline";
import plusicon from "../assets/icon/plus.png";

const Background = styled.div`
  width: 100vw;
  min-height: 100vh;
  background: #e29f91;

  display: flex;
  justify-content: center;
  align-items: center;
`;

const Box = styled.div`
  width: 1440px;
  height: 910px;
  background: #fdfbf8;

  display: flex;
  justify-content: space-between;
  align-items: flex-start; /* 상단 정렬 */
`;

const Left = styled.div`
  width: 200px;
  height: 100%;
`;

const Right = styled.div`
  width: 200px;
  height: 100%;
`;

const Top = styled.div`
  height: 60px;
  width: 1040px;
  display: flex;
  justify-content: flex-end; /* 오른쪽 정렬 */
  align-items: center; /* 수직 가운데 정렬 */
`;

const Container = styled.div`
  height: 20px;
  width: 1040px;
`;

const HeaderBox = styled.div`
  height: 60px;
  width: 1040px;
  display: flex;
  justify-content: center; /* 오른쪽 정렬 */
  align-items: center; /* 수직 가운데 정렬 */
`;

const Content = styled.div`
  height: auto;
  width: 1040px;

  border: 1px solid red;
`;

const Line = styled.div`
  height: 4px;
  width: 1040px;

  background: #4a4e4d;
`;

const Timeline = styled.div`
  display: flex; /* Flexbox 사용 */
  flex-direction: column; /* 세로 정렬 */
  gap: 30px; /* 자식 요소 간 간격 */
  margin-top: 30px;
`;

const TitleText = styled.div`
  height: 35px;
  color: #4a4e4d;
  font-family: Roboto;
  font-size: 30px;
  font-style: normal;
  font-weight: 600;
  line-height: normal;
`;

const PlusIconWrapper = styled.div`
  display: flex;
  justify-content: center; /* 가로 중앙 정렬 */
  align-items: center; /* 세로 중앙 정렬 */
  margin-top: 40px;
`;

const PlusIcon = styled.img`
  width: 30px;
  height: 30px;
  cursor: pointer; /* 클릭 가능하도록 스타일 추가 */
`;

export default function AboutMe() {
  return (
    <Background>
      <Box>
        <Left></Left>
        <div>
          <Top>
            <Icon />
          </Top>
          <HeaderBox>
            <Header />
          </HeaderBox>
          <Container />
          <Content>
            <MyInfo />
            <Line />
            <Timeline>
              <TitleText>Timeline</TitleText>
              <TimelineComponent
                date="2022.03.02 - 현재"
                content="This is a timeline event."
              />
              <TimelineComponent
                date="2024.03.02 - 2024.08.23"
                content="Another timeline event."
              />
            </Timeline>
            <PlusIconWrapper>
              <PlusIcon src={plusicon} alt="Add more" />
            </PlusIconWrapper>
            <Line />
          </Content>
        </div>

        <Right></Right>
      </Box>
    </Background>
  );
}
